import React from 'react';
import './Item.css'

const Item = (props) => {
    return (
        <div className='item'>
            <img src={props.image} alt="" />

            <div className='item-price'>

                <h5>{props.name}</h5>
                <h4>${props.price}</h4>
            </div>
        </div>
    );
};

export default Item;
